import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import PrivateRoute from './PrivateRoute';

import Login from './Pages/Auth/Login';
import Register from './Pages/Auth/Register';

import Home from './Pages/Home';
import AdminDashboard from './Pages/Dashboard/DashboardAdmin';
import DashboardMinistere from './Pages/Dashboard/DashboardMinistere';
import DashboardEntreprise from './Pages/Dashboard/DashboardEntreprise';

import OffreEntreprise from './Pages/Offre/OffresEntreprise';
import OffreAdmin from './Pages/Offre/OffreAdmin';
import PostulerOffre from './Pages/Offre/PostulerOffre';
import MesCandidatures from './Pages/Offre/MesCandidatures';

import EntrepriseHome from './Pages/EntrepriseHome';
import ValidationCandidatures from './Pages/Candidature/ValidationCandidatures';
import ValidationOffres from './Pages/Offre/ValidationOffres';

function RedirectAfterLogin() {
  const { user } = useAuth();

  if (!user) return <Navigate to="/login" replace />;
  if (user.role === 'admin' || user.role === 'ministere') return <Navigate to="/dashboard/ministre" replace />;
  if (user.role === 'entreprise') return <Navigate to="/dashboard/entreprise" replace />;

  return <Navigate to="/" replace />;
}

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>

          {/* Page d'accueil */}
          <Route path="/" element={<Home />} />

          {/* Authentification */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Redirection après login */}
          <Route path="/redirect" element={<RedirectAfterLogin />} />

          {/* Pages Admin / Ministère */}
          <Route path="/dashboard/admin" element={
            <PrivateRoute roles={['admin']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/dashboard/ministre" element={
            <PrivateRoute roles={['admin', 'ministere']}>
              <DashboardMinistere />
            </PrivateRoute>
          } />

          <Route path="/validation/candidatures" element={
            <PrivateRoute roles={['admin', 'ministere']}>
              <ValidationCandidatures />
            </PrivateRoute>
          } />

          <Route path="/validation/offres" element={
            <PrivateRoute roles={['admin', 'ministere']}>
              <ValidationOffres />
            </PrivateRoute>
          } />

          <Route path="/admin/offres" element={
            <PrivateRoute roles={['admin']}>
              <OffreAdmin />
            </PrivateRoute>
          } />

          {/* Pages entreprise */}
          <Route path="/entreprise/home" element={
            <PrivateRoute roles={['entreprise']}>
              <EntrepriseHome />
            </PrivateRoute>
          } />

          <Route path="/dashboard/entreprise" element={
            <PrivateRoute roles={['entreprise']}>
              <DashboardEntreprise />
            </PrivateRoute>
          } />

          <Route path="/entreprise/offres" element={
            <PrivateRoute roles={['entreprise']}>
              <OffreEntreprise />
            </PrivateRoute>
          } />

          <Route path="/entreprise/candidatures" element={
            <PrivateRoute roles={['entreprise']}>
              <MesCandidatures />
            </PrivateRoute>
          } />

          <Route path="/entreprise/postuler/:offerId" element={
            <PrivateRoute roles={['entreprise']}>
              <PostulerOffre />
            </PrivateRoute>
          } />

          {/* 404 fallback */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
